import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate, Link } from 'react-router-dom';
import { GoogleLogin } from '@react-oauth/google';
import './Auth.css';

const Login = () => {
  const [formData, setFormData] = useState({
    email: '',
    password: ''
  });
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);
  const [showPassword, setShowPassword] = useState(false);

  const navigate = useNavigate();
  const { email, password } = formData;

  const onChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
    setError('');
  };

  // üîê Normal Login
  const onSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');

    try {
      const res = await axios.post(
        'http://localhost:5000/api/auth/login',
        formData
      );

      localStorage.setItem('token', res.data.token);
      localStorage.setItem('user', JSON.stringify(res.data.user));

      if (res.data.user.role === 'admin') {
        navigate('/admin-dashboard');
      } else {
        navigate('/dashboard');
      }
    } catch (err) {
      setError(err.response?.data?.message || 'Login failed');
    } finally {
      setLoading(false);
    }
  };

  // üîë Google Login
  const handleGoogleSuccess = async (res) => {
    try {
      const response = await axios.post(
        'http://localhost:5000/api/auth/google',
        { token: res.credential }
      );

      localStorage.setItem('token', response.data.token);
      localStorage.setItem('user', JSON.stringify(response.data.user));

      navigate('/dashboard');
    } catch (error) {
      console.error(error);
      alert('Google login failed');
    }
  };

  return (
    <div className="auth-container-modern">
      <div className="auth-background">
        <div className="gradient-circle circle-1"></div>
        <div className="gradient-circle circle-2"></div>
        <div className="gradient-circle circle-3"></div>
      </div>

      <div className="auth-card-modern">
        <div className="auth-header-modern">
          <div className="brand-logo">
            <div className="logo-icon">üöÄ</div>
            <h1>Authra</h1>
          </div>
          <h2>Welcome Back</h2>
          <p>Enter your credentials to access your account</p>
        </div>

        {error && (
          <div className="error-message-modern">
            <span className="error-icon">‚ö†Ô∏è</span>
            {error}
          </div>
        )}

        <form onSubmit={onSubmit} className="auth-form-modern">
          <div className="form-group-modern">
            <label>
              <span className="label-icon">üìß</span>
              Email Address
            </label>
            <input
              type="email"
              name="email"
              value={email}
              onChange={onChange}
              required
              disabled={loading}
              className="input-modern"
            />
          </div>

          <div className="form-group-modern">
            <label>
              <span className="label-icon">üîí</span>
              Password
            </label>
            <div className="input-wrapper password-wrapper">
              <input
                type={showPassword ? 'text' : 'password'}
                name="password"
                value={password}
                onChange={onChange}
                required
                disabled={loading}
                className="input-modern"
              />
              <button
                type="button"
                className="password-toggle"
                onClick={() => setShowPassword(!showPassword)}
              >
                {showPassword ? 'üëÅÔ∏è' : 'üëÅÔ∏è‚Äçüó®Ô∏è'}
              </button>
            </div>
          </div>

          <div className="form-footer-modern">
            <label className="remember-me">
              <input type="checkbox" />
              <span>Remember me</span>
            </label>
            <Link to="/forgot-password" className="forgot-link">
              Forgot password?
            </Link>
          </div>

          <button type="submit" disabled={loading} className="btn-primary-modern">
            {loading ? 'Signing in...' : 'Sign In ‚Üí'}
          </button>
        </form>

        <div className="auth-divider">
          <span>OR</span>
        </div>

        {/* ‚úÖ WORKING GOOGLE LOGIN */}
        <div className="social-login">
          <GoogleLogin
            onSuccess={handleGoogleSuccess}
            onError={() => alert('Google Login Failed')}
          />
        </div>

        <div className="auth-footer-modern">
          <p>
            Don&apos;t have an account?
            <Link to="/signup" className="signup-link"> Create one</Link>
          </p>
        </div>
      </div>
    </div>
  );
};

export default Login;
